export default function App() {
const [log, setLog] = useState(false);


  return (
    <BrowserRouter>
      <Routes>


<Header/>
      <Route path="/" element={<Login />} />



        </Routes>
    </BrowserRouter>

  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
